import React from "react";
import { useParams } from "react-router-dom";
import Breadcrums from "../components/Breadcrumbs";
import { CatalogList } from "../utils/constants";
import noimage from "../assets/images/noimage.png";

const CatalogSectionPage = () => {
  const params = useParams();
  const topic = CatalogList.filter((item) => item.slug === params.slug)[0];
  return (
    <>
      <Breadcrums title={topic.title} />
      <div className="container">
        <div className="row">
          {topic.section &&
            topic.section.map((item) => (
              <div
                className="col-12 col-sm-12 col-md-6 col-lg-6 col-xl-6"
                key={item.slug}
              >
                <div className="catalog_razdel">
                  <table>
                    <tbody>
                      <tr>
                        <td className="catalog_razdel_image">
                          <a href={`/catalog/${topic.slug}/${item.slug}`}>
                            <img
                              src={
                                item.image ? `/images/${item.image}` : noimage
                              }
                              alt={item.title}
                            />
                          </a>
                        </td>
                        <td>
                          <a
                            className="catalog_razdel_a"
                            href={`/catalog/${topic.slug}/${item.slug}`}
                          >
                            {item.title}
                          </a>

                          <div className="catalog_razdel_text"></div>
                          <div className="catalog_razdel_link">
                            <a href={`/catalog/${topic.slug}/${item.slug}`}>
                              Весь перечень
                            </a>
                          </div>
                        </td>
                      </tr>
                    </tbody>
                  </table>
                </div>
              </div>
            ))}
        </div>
      </div>
    </>
  );
};

export default CatalogSectionPage;
